import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element={<HomePage />} />
          {/* Здесь можно будет добавить другие маршруты */}
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
